import { useMemo, useState } from "react"
import Select from 'react-select'
import countryList from 'react-select-country-list'
const FirstPage = (props) => {
    const options = [
        { value: 'Permanent Resident', label: 'Permanent Resident' },
        { value: 'Visitor', label: 'Visitor' },
        { value: 'vanilla', label: 'Vanilla' }
    ]
    const [value, setValue] = useState('')
    const optionsCountry = useMemo(() => countryList().getData(), [])
    const changeHandler = value => {
            setValue(value)
    }
   
    return(
        <>
            <div>Application context</div>
            <div>Current location</div>
            <div>Give details of the applicant's current location.</div>
            <div className='status'>
                <span className='title-status'>Current location:</span>
                <Select options={optionsCountry} value={value} onChange={changeHandler} className="select" />
            </div>
            <div className='status'>
                <span className='title-status'>Legal status:</span>
                <Select options={options} className="select"/>
            </div>
        </>
        
    )
}
export default FirstPage;
